{"featureReduction": null, "drawingInfo": {"labelingInfo": [{"name": "Default", "deconflictionStrategy": "dynamic", "labelExpressionInfo": {"expression": "$feature.DIAMETER + '" ' + $feature.FACILITYID", "title": "Custom"}, "labelPlacement": "esriServerLinePlacementCenterAlong", "repeatLabel": false, "symbol": {"type": "esriTS", "color": [0, 0, 0, 255], "font": {"family": "Corbel", "size": 7}, "horizontalAlignment": "left", "kerning": true, "haloColor": [245, 245, 245, 255], "haloSize": 1, "rightToLeft": false, "rotated": false, "text": "", "verticalAlignment": "baseline", "xoffset": 0, "yoffset": 0, "angle": 0}, "useCodedValues": true}], "renderer": {"type": "uniqueValue", "valueExpression": "// Write a script that returns a value that will be used to draw features.
// For example, find the percentage of oak trees:
// Round(($feature.oak_count / $feature.all_trees_count) * 100, 2)

When($feature.AssetOwner_2019 == 'City of Grants Pass' && $feature.AssetStatus_2019 == 'Active', 'City Owned - Active',
  $feature.AssetOwner_2019 == 'City of Grants Pass' && $feature.AssetStatus_2019 == 'Abandoned', 'City Owned - Abandoned',
  $feature.AssetOwner_2019 == 'Private' && $feature.AssetStatus_2019 == 'Active', 'Private - Active',
