Round", "lineStyle3D": "Strip", "miterLimit": 10, "width": 1.19, "color": [104, 104, 104, 255]}, {"type": "CIMSolidStroke", "enable": true, "capStyle": "Butt", "joinStyle": "Miter", "lineStyle3D": "Strip", "miterLimit": 10, "width": 1.5, "color": [204, 204, 204, 255]}]}}, "value": "Private - Active"}]}}}

{"drawingInfo": {"labelingInfo": [{"name": "Default", "deconflictionStrategy": "dynamic", "labelExpressionInfo": {"expression": "$feature.DIAMETER + '" ' + $feature.FACILITYID", "title": "Custom"}, "labelPlacement": "esriServerLinePlacementCenterAlong", "repeatLabel": false, "symbol": {"type": "esriTS", "color": [0, 0, 0, 255], "font": {"family": "Corbel", "size": 7}, "horizontalAlignment": "left", "kerning": true, "haloColor": [245, 245, 245, 255], "haloSize": 1, "rightToLeft": false, "rotated": false, "text": "", "verticalAlignment": "baseline", "xoffset": 0, "yoffset": 0, "angle": 0}, "useCodedValues": true}], "renderer": {"type": "uniqueValue", "visualVariables": [{"type": "sizeInfo", "valueExpression": "$view.scale", "stops": [{"size": 6, "value": 70.5310735}, {"size": 3, "value": 564.248588}, {"size": 2.25, "value": 4513.988705}, {"size": 1.5, "value": 36111.909643}]}], "valueExpression": "// Write a script that returns a value that will be used to draw features.
// For example, find the percentage of oak trees:
// Round(($feature.oak_count / $feature.all_trees_count) * 100, 2)

var size_class = When($feature.DIAMETER == null || $feature.DIAMETER == 0, '0 or null',
  $feature.DIAMETER > 0 && $feature.DIAMETER <= 4, '4" or less',
  $feature.DIAMETER > 4 && $feature.DIAMETER <= 10, '10" or less',
  $feature.DIAMETER > 10, 'more than 10"',
  'other')

return size_class", "valueExpressionTitle": "Size Class", "uniqueValueGroups": [{"classes": [{"label": "0 or null", "symbol": {"type": "esriSLS", "color": [217, 0, 255, 255], "width": 0.75, "style": "esriSLSSolid"}, "values": [["0 or null"]]}, {"label": "4" or less", "symbol": {"type": "esriSLS", "color": [212, 0, 4, 255], "width": 0.75, "style": "esriSLSSolid"}, "values": [["4" or less"]]}, {"label": "10" or less", "symbol": {"type": "esriSLS", "color": [0, 195, 255, 255], "width": 1.5, "style": "esriSLSSolid"}, "values": [["10" or less"]]}, {"label": "more than 10"", "symbol": {"type": "esriSLS", "color": [0, 0, 255, 255], "width": 3, "style": "esriSLSSolid"}, "values": [["more than 10""]]}]}], "uniqueValueInfos": [{"label": "0 or null", "symbol": {"type": "esriSLS", "color": [217, 0, 255, 255], "width": 0.75, "style": "esriSLSSolid"}, "value": "0 or null"}, {"label": "4" or less", "symbol": {"type": "esriSLS", "color": [212, 0, 4, 255], "width": 0.75, "style": "esriSLSSolid"}, "value": "4" or less"}, {"label": "10" or less", "symbol": {"type": "esriSLS", "color": [0, 195, 255, 255], "width": 1.5, "style": "esriSLSSolid"}, "value": "10" or less"}, {"label": "more than 10"", "symbol": {"type": "esriSLS", "color": [0, 0, 255, 255], "width": 3, "style": "esriSLSSolid"}, "value": "more than 10""}]}}}
